import {readFileSync} from 'fs';

let testconfig = ""
let testdata = ""

if (process.env.NODE_ENV != "production") {
    let head = readFileSync("./public/boot.js").toString()
    let cfg = readFileSync("../../../.dashboard.js").toString()
    let tail = readFileSync("./public/init.js").toString()
     
    testconfig = head + cfg + tail

    testdata = ""
}

export default {testdata,testconfig}
